import java.io.File;
import java.io.FileOutputStream;
import java.util.Base64;

public class PngDecoder {

    public static void main(String[] args) throws Exception {
        decode(new String[][]{
                new String[]{},
                new String[]{
                        "791,1042_\n",
                        "817,898_\n",
                        "903,791_\n",
                        "1079,732_\n",
                        "1256,785_\n",
                        "1363,908_\n",
                        "1384,1047_\n",
                },
                new String[]{
                        "488,994_\n",
                        "544,849_\n",
                        "588,711_\n",
                        "711,599_\n",
                        "855,533_\n",
                        "999,511_\n",
                        "1133,505_\n",
                        "1422,549_\n",
                        "1527,655_\n",
                        "1594,766_\n",
                        "1655,888_\n",
                        "1688,1033_\n",
                },
                new String[]{
                        "244,933_\n",
                        "272,755_\n",
                        "322,611_\n",
                        "405,472_\n",
                        "605,327_\n",
                        "772,233_\n",
                        "922,183_\n",
                        "1099,183_\n",
                        "1272,199_\n",
                        "1438,249_\n",
                        "1583,316_\n",
                        "1699,411_\n",
                        "1838,577_\n",
                        "1910,722_\n",
                        "1966,849_\n",
                        "1971,1016_\n",
                },
        });
    }

    private static void decode(String[][] pngs) throws Exception {
        File dir = new File("../where_sitting/img");
        Base64.Decoder decoder = Base64.getDecoder();

        System.out.println("[");
        for (int row = 0; row < pngs.length; row++) {
            String[] png = pngs[row];

            for (int col = 0; col < png.length; col++) {
                String base64 = png[col].trim();

                String[] split = base64.split("_", 2);
                String x = split[0].split(",")[0];
                String y = split[0].split(",")[1];
                String base64Png = split[1];

                File file = new File(dir, String.format("%02d_%02d.png", row, col + 1));
                System.out.printf("    [%s, %s, \"%s\"],%n", x, y, file.getName());

                try (FileOutputStream out = new FileOutputStream(file)) {
                    out.write(decoder.decode(base64Png));
                }
            }
        }
        System.out.println("]");
    }

}
